{
  "actions": [
    {
      "title": "Create Space",
      "description": "Creates a new meeting space for Google Meet conferences.",
      "type": "action",
      "documentation": "https://developers.google.com/workspace/meet/api/reference/rest/v2/spaces/insert",
      "endpointUrl": "/v2/spaces",
      "apiBaseUrl": "https://meet.googleapis.com",
      "method": "POST",
      "sampleResponse": {
        "spaceId": "sample_space_id",
        "name": "Sample Space",
        "status": "active"
      },
      "inputSchema": {
        "type": "object",
        "description": "Input parameters for creating a space",
        "properties": {
          "displayName": {
            "type": "string",
            "description": "The display name for the meeting space."
          },
          "meetingOptions": {
            "type": "object",
            "description": "Configuration options for the meeting space such as settings and preferences."
          }
        }
      },
      "outputType": {
        "outputType": "object"
      }
    },
    {
      "title": "Get Space",
      "description": "Retrieves details about a specific meeting space using its identifier.",
      "type": "action",
      "documentation": "https://developers.google.com/workspace/meet/api/reference/rest/v2/spaces/get",
      "endpointUrl": "/v2/spaces/{name}",
      "apiBaseUrl": "https://meet.googleapis.com",
      "method": "GET",
      "sampleResponse": {
        "spaceId": "sample_space_id",
        "name": "Sample Space",
        "details": {
          "displayName": "Meeting Room A",
          "settings": {}
        }
      },
      "inputSchema": {
        "type": "object",
        "description": "Input parameters for retrieving space details",
        "properties": {
          "name": {
            "type": "string",
            "description": "Identifier of the space."
          }
        }
      },
      "outputType": {
        "outputType": "object"
      }
    },
    {
      "title": "Update Space",
      "description": "Updates settings for an existing meeting space.",
      "type": "action",
      "documentation": "https://developers.google.com/workspace/meet/api/reference/rest/v2/spaces/patch",
      "endpointUrl": "/v2/spaces/{name}",
      "apiBaseUrl": "https://meet.googleapis.com",
      "method": "PATCH",
      "sampleResponse": {
        "spaceId": "sample_space_id",
        "name": "Updated Space",
        "status": "updated"
      },
      "inputSchema": {
        "type": "object",
        "description": "Input parameters for updating a space",
        "properties": {
          "name": {
            "type": "string",
            "description": "Identifier of the space to be updated."
          },
          "updates": {
            "type": "object",
            "description": "A JSON object with the fields to update in the space."
          }
        }
      },
      "outputType": {
        "outputType": "object"
      }
    },
    {
      "title": "End Active Conference",
      "description": "Ends an active conference within a specified meeting space.",
      "type": "action",
      "documentation": "https://developers.google.com/workspace/meet/api/reference/rest/v2/spaces/endActiveConference",
      "endpointUrl": "/v2/spaces/{name}:endActiveConference",
      "apiBaseUrl": "https://meet.googleapis.com",
      "method": "POST",
      "sampleResponse": {
        "spaceId": "sample_space_id",
        "ended": true
      },
      "inputSchema": {
        "type": "object",
        "description": "Input parameters to end an active conference",
        "properties": {
          "name": {
            "type": "string",
            "description": "Identifier of the space where the conference is active."
          }
        }
      },
      "outputType": {
        "outputType": "object"
      }
    },
    {
      "title": "Find Conferences",
      "description": "Finds conference records with optional search criteria.",
      "type": "action",
      "documentation": "https://developers.google.com/workspace/meet/api/reference/rest/v2/conferenceRecords/list",
      "endpointUrl": "/v2/conferenceRecords",
      "apiBaseUrl": "https://meet.googleapis.com",
      "method": "GET",
      "sampleResponse": {
        "items": [
          {
            "conferenceId": "conf_1",
            "title": "Quarterly Meeting"
          }
        ]
      },
      "inputSchema": {
        "type": "object",
        "description": "Input parameters for finding conference records",
        "properties": {
          "query": {
            "type": "string",
            "description": "Search query to filter conference records."
          }
        }
      },
      "outputType": {
        "outputType": "array",
        "arrayPropertyValue": "items"
      }
    },
    {
      "title": "Get Conference",
      "description": "Retrieves a specific conference record by its identifier.",
      "type": "action",
      "documentation": "https://developers.google.com/workspace/meet/api/reference/rest/v2/conferenceRecords/get",
      "endpointUrl": "/v2/conferenceRecords/{name}",
      "apiBaseUrl": "https://meet.googleapis.com",
      "method": "GET",
      "sampleResponse": {
        "conferenceId": "conf_1",
        "title": "Quarterly Meeting",
        "details": {}
      },
      "inputSchema": {
        "type": "object",
        "description": "Input parameters for retrieving a conference record",
        "properties": {
          "name": {
            "type": "string",
            "description": "Unique identifier of the conference record."
          }
        }
      },
      "outputType": {
        "outputType": "object"
      }
    },
    {
      "title": "Find Participants",
      "description": "Finds participants in a given conference record based on search criteria.",
      "type": "action",
      "documentation": "https://developers.google.com/workspace/meet/api/reference/rest/v2/conferenceRecords/participants/list",
      "endpointUrl": "/v2/conferenceRecords/{parent}/participants",
      "apiBaseUrl": "https://meet.googleapis.com",
      "method": "GET",
      "sampleResponse": {
        "items": [
          {
            "participantId": "participant_1",
            "name": "John Doe"
          }
        ]
      },
      "inputSchema": {
        "type": "object",
        "description": "Input parameters for finding participants",
        "properties": {
          "parent": {
            "type": "string",
            "description": "Identifier of the conference record."
          },
          "query": {
            "type": "string",
            "description": "Search term to filter participants."
          }
        }
      },
      "outputType": {
        "outputType": "array",
        "arrayPropertyValue": "items"
      }
    },
    {
      "title": "Get Participant",
      "description": "Retrieves details of a specific participant from a conference record.",
      "type": "action",
      "documentation": "https://developers.google.com/workspace/meet/api/reference/rest/v2/conferenceRecords/participants/get",
      "endpointUrl": "/v2/conferenceRecords/{parent}/participants/{name}",
      "apiBaseUrl": "https://meet.googleapis.com",
      "method": "GET",
      "sampleResponse": {
        "participantId": "participant_1",
        "name": "John Doe",
        "status": "joined"
      },
      "inputSchema": {
        "type": "object",
        "description": "Input parameters for getting a participant's details",
        "properties": {
          "parent": {
            "type": "string",
            "description": "Identifier of the conference record."
          },
          "name": {
            "type": "string",
            "description": "Identifier of the participant."
          }
        }
      },
      "outputType": {
        "outputType": "object"
      }
    },
    {
      "title": "Find Participant Sessions",
      "description": "Finds sessions associated with a specific participant in a conference.",
      "type": "action",
      "documentation": "https://developers.google.com/workspace/meet/api/reference/rest/v2/conferenceRecords/participants/participantSessions/list",
      "endpointUrl": "/v2/conferenceRecords/{conferenceId}/participants/{participantId}/participantSessions",
      "apiBaseUrl": "https://meet.googleapis.com",
      "method": "GET",
      "sampleResponse": {
        "items": [
          {
            "sessionId": "session_1",
            "status": "active"
          }
        ]
      },
      "inputSchema": {
        "type": "object",
        "description": "Input parameters for finding participant sessions",
        "properties": {
          "conferenceId": {
            "type": "string",
            "description": "Identifier of the conference record."
          },
          "participantId": {
            "type": "string",
            "description": "Identifier of the participant."
          },
          "query": {
            "type": "string",
            "description": "Search term to filter sessions."
          }
        }
      },
      "outputType": {
        "outputType": "array",
        "arrayPropertyValue": "items"
      }
    },
    {
      "title": "Get Participant Session",
      "description": "Retrieves details of a specific participant session.",
      "type": "action",
      "documentation": "https://developers.google.com/workspace/meet/api/reference/rest/v2/conferenceRecords/participants/participantSessions/get",
      "endpointUrl": "/v2/conferenceRecords/{conferenceId}/participants/{participantId}/participantSessions/{name}",
      "apiBaseUrl": "https://meet.googleapis.com",
      "method": "GET",
      "sampleResponse": {
        "sessionId": "session_1",
        "status": "active",
        "startTime": "2023-10-10T10:00:00Z"
      },
      "inputSchema": {
        "type": "object",
        "description": "Input parameters for retrieving a participant session",
        "properties": {
          "conferenceId": {
            "type": "string",
            "description": "Identifier of the conference record."
          },
          "participantId": {
            "type": "string",
            "description": "Identifier of the participant."
          },
          "name": {
            "type": "string",
            "description": "Identifier of the participant session."
          }
        }
      },
      "outputType": {
        "outputType": "object"
      }
    },
    {
      "title": "Find Recordings",
      "description": "Finds recordings associated with a particular conference record.",
      "type": "action",
      "documentation": "https://developers.google.com/workspace/meet/api/reference/rest/v2/conferenceRecords/recordings/list",
      "endpointUrl": "/v2/conferenceRecords/{parent}/recordings",
      "apiBaseUrl": "https://meet.googleapis.com",
      "method": "GET",
      "sampleResponse": {
        "items": [
          {
            "recordingId": "rec_1",
            "duration": 3600
          }
        ]
      },
      "inputSchema": {
        "type": "object",
        "description": "Input parameters for finding recordings",
        "properties": {
          "parent": {
            "type": "string",
            "description": "Identifier of the conference record."
          },
          "query": {
            "type": "string",
            "description": "Search term to filter recordings."
          }
        }
      },
      "outputType": {
        "outputType": "array",
        "arrayPropertyValue": "items"
      }
    },
    {
      "title": "Get Recording",
      "description": "Retrieves a specific recording by its identifier from a conference record.",
      "type": "action",
      "documentation": "https://developers.google.com/workspace/meet/api/reference/rest/v2/conferenceRecords/recordings/get",
      "endpointUrl": "/v2/conferenceRecords/{parent}/recordings/{name}",
      "apiBaseUrl": "https://meet.googleapis.com",
      "method": "GET",
      "sampleResponse": {
        "recordingId": "rec_1",
        "duration": 3600,
        "url": "https://meet.googleapis.com/recordings/rec_1"
      },
      "inputSchema": {
        "type": "object",
        "description": "Input parameters for retrieving a recording",
        "properties": {
          "parent": {
            "type": "string",
            "description": "Identifier of the conference record."
          },
          "name": {
            "type": "string",
            "description": "Identifier of the recording."
          }
        }
      },
      "outputType": {
        "outputType": "object"
      }
    },
    {
      "title": "Find Transcripts",
      "description": "Finds transcripts related to a specific conference record.",
      "type": "action",
      "documentation": "https://developers.google.com/workspace/meet/api/reference/rest/v2/conferenceRecords/transcripts/list",
      "endpointUrl": "/v2/conferenceRecords/{parent}/transcripts",
      "apiBaseUrl": "https://meet.googleapis.com",
      "method": "GET",
      "sampleResponse": {
        "items": [
          {
            "transcriptId": "trans_1",
            "language": "en"
          }
        ]
      },
      "inputSchema": {
        "type": "object",
        "description": "Input parameters for finding transcripts",
        "properties": {
          "parent": {
            "type": "string",
            "description": "Identifier of the conference record."
          },
          "query": {
            "type": "string",
            "description": "Search term to filter transcripts."
          }
        }
      },
      "outputType": {
        "outputType": "array",
        "arrayPropertyValue": "items"
      }
    },
    {
      "title": "Get Transcript",
      "description": "Retrieves a specific transcript by its identifier.",
      "type": "action",
      "documentation": "https://developers.google.com/workspace/meet/api/reference/rest/v2/conferenceRecords/transcripts/get",
      "endpointUrl": "/v2/conferenceRecords/{parent}/transcripts/{name}",
      "apiBaseUrl": "https://meet.googleapis.com",
      "method": "GET",
      "sampleResponse": {
        "transcriptId": "trans_1",
        "language": "en",
        "contentUrl": "https://meet.googleapis.com/transcripts/trans_1"
      },
      "inputSchema": {
        "type": "object",
        "description": "Input parameters for retrieving a transcript",
        "properties": {
          "parent": {
            "type": "string",
            "description": "Identifier of the conference record."
          },
          "name": {
            "type": "string",
            "description": "Identifier of the transcript."
          }
        }
      },
      "outputType": {
        "outputType": "object"
      }
    },
    {
      "title": "Find Transcript Entries",
      "description": "Finds transcript entries for a given transcript.",
      "type": "action",
      "documentation": "https://developers.google.com/workspace/meet/api/reference/rest/v2/conferenceRecords/transcripts/entries/list",
      "endpointUrl": "/v2/conferenceRecords/{parent}/transcripts/{transcriptId}/entries",
      "apiBaseUrl": "https://meet.googleapis.com",
      "method": "GET",
      "sampleResponse": {
        "items": [
          {
            "entryId": "entry_1",
            "text": "Hello, welcome to the meeting."
          }
        ]
      },
      "inputSchema": {
        "type": "object",
        "description": "Input parameters for finding transcript entries",
        "properties": {
          "parent": {
            "type": "string",
            "description": "Identifier of the conference record."
          },
          "transcriptId": {
            "type": "string",
            "description": "Identifier of the transcript."
          },
          "query": {
            "type": "string",
            "description": "Search term to filter transcript entries."
          }
        }
      },
      "outputType": {
        "outputType": "array",
        "arrayPropertyValue": "items"
      }
    },
    {
      "title": "Get Transcript Entry",
      "description": "Retrieves details of a specific transcript entry.",
      "type": "action",
      "documentation": "https://developers.google.com/workspace/meet/api/reference/rest/v2/conferenceRecords/transcripts/entries/get",
      "endpointUrl": "/v2/conferenceRecords/{parent}/transcripts/{transcriptId}/entries/{name}",
      "apiBaseUrl": "https://meet.googleapis.com",
      "method": "GET",
      "sampleResponse": {
        "entryId": "entry_1",
        "text": "Hello, welcome to the meeting.",
        "timestamp": "2023-10-10T10:05:00Z"
      },
      "inputSchema": {
        "type": "object",
        "description": "Input parameters for retrieving a transcript entry",
        "properties": {
          "parent": {
            "type": "string",
            "description": "Identifier of the conference record."
          },
          "transcriptId": {
            "type": "string",
            "description": "Identifier of the transcript."
          },
          "name": {
            "type": "string",
            "description": "Identifier of the transcript entry."
          }
        }
      },
      "outputType": {
        "outputType": "object"
      }
    }
  ],
  "authentication": {
    "type": "oauth2",
    "authUrl": "https://accounts.google.com/o/oauth2/auth",
    "tokenUrl": "https://oauth2.googleapis.com/token",
    "profileInfoUrl": "https://www.googleapis.com/oauth2/v3/userinfo"
  },
  "serviceJson": {
    "name": "appmixer.googleMeet",
    "label": "Google Meet",
    "category": "applications",
    "description": "Google Meet Connector providing functionalities for meeting spaces, conference records, participants, and meeting artifacts.",
    "version": "1.0.0",
    "icon": "https://upload.wikimedia.org/wikipedia/commons/5/5b/Google_Meet_logo.svg"
  }
}
